import { mdiDesktopMac, mdiAccountMultiple } from "@mdi/js";

export default [
  "HIRING SIDE",
  [
    {
      to: "/",
      icon: mdiDesktopMac,
      label: "Dashboard",
    },
  ],

  "BACKEND SIDE",
  [
    {
      to: "/organizations",
      label: "Organization",
      updateMark: true,
      icon: mdiAccountMultiple,
    },
  ],
];
